  { name: 'More', href: '#', current: false },
  { name: 'Cart', href: '#', current: false },
]
export const Navbar = (props: {}) => {
  return (
    <nav>
      <div className="flex  justify-around bg-blue-600">
        <div> Logo </div>
        <div className=' bg-white p-1 m-2 rounded flex justify-between
          min-w-[30%]'>
          <input name="search-label" placeholder='Search for Products' type="input" className='bg-white  px-1.5 outline-none w-[100%]	 py-0.2 text-black-400' />
